import React from "react";
import "./Projects.css"

const Projects: React.FC = () => {
    return (
        <div className="projects_wrapper">
            <h1>My Projects</h1>
            <div className="single_project_wrapper">

                {/*title section*/}
                <div className="title_wrapper">
                    <h3 className="number">[a]</h3>
                    <h3>&nbsp;&nbsp;</h3>
                    <h3 className="title">Zoomie Roomies</h3>
                </div>

                {/*about project section*/}
                <p>


                    {/*Grouped with five students within COM SCI 130: Software Engineering (taught by <a href="http://www.opencaesar.io/contributors/Maged%20Elaasar.html" target="_blank" rel="noreferrer">Professor Maged Elaasar</a>),*/}
                    {/*our group */}
                </p>
            </div>
        </div>
    );
}

export default Projects;
